import styled from "styled-components";

import { ICouponList } from "@interfaces";
import { CouponItem } from "./Item";

interface IProps {
    data: ICouponList[];
    handleCoupon: (id: string) => void;
    isShowPreview: boolean;
    handleToggleShowPreview: () => void;
}

export const CouponList = (props: IProps) => {
    const { data, handleCoupon, isShowPreview, handleToggleShowPreview } = props;

    return (
        <StyledContainer>
            {data.map((item) => {
                return (
                    <CouponItem
                        isShowPreview={isShowPreview}
                        handleToggleShowPreview={handleToggleShowPreview}
                        data={item.qrtable}
                        handleCoupon={handleCoupon}
                        key={item._id}
                    />
                );
            })}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 88%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
`;
